import { Wrapper, TypeWriterWrapper } from "./styles";
import Typewriter from "../Typewriter";
const Homepage = () => {
	return (
		<Wrapper>
			<TypeWriterWrapper>
				<Typewriter />
			</TypeWriterWrapper>
			<Particles />
		</Wrapper>
	);
};
export default Homepage;
